import React from "react";
import { Link } from "react-router-dom";

const Footer = () => {
  return (
    <div className="h-[200px] flex items-center justify-center bg-yellow-700">
      <Link to={`https://www.themoviedb.org/terms-of-use`}>Terms of Use</Link>
    </div>
  );
};

export default Footer;
